Sources et méthodes:
I = (N1 x N2 ) / (N3 x N4) exprimé en % avec :
N1 = nombre total de m² présentation des collections permanentes réellement ouverts ;
N2 = nombre réel d'heures d'ouverture au public ;
N3 = nombre total de m² présentation des collections permanentes totaux en état d'être ouverts au public ;
N4 = nombre théorique d'heures d'ouverture au public.
